node.text:
Hidangan laut dari kepiting, lobster, kerang, cumi, udang lengkap disajikan secara unik dan menarik di The Crabbys. Menu hidangan seafood tanpa wadah alias ditaruh diatas meja (tentu saja dengan alas yang terjamin kebersihannya ) dan dicampur baluran saus kaya rasa bisa dimakan rame-rame bikin suasana makan jadi asik dan akrab.
.
